import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor(){
    super();

    this.state = {
      monsters:[
        {
          name: 'Frankestine',
          id: 1
        },{
          name: 'Dracula',
          id: 2
        },{
          name: 'Zombie',
          id: 3
        }
      ]
    };
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map(monster => 
          <h2 key={monster.id}>{monster.name}</h2>
          )
        }
      </div>
    ) 
  }
}

export default App;
